import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';

function Welcome() {

    return (
            <div className="container mt-5 mx-auto w-25 " >
                <label for="exampleInputEmail1" className="form-label h2 w-100 text-center">Menu</label>
                <div className="row align-items-center mt-3">
                    <Link className="btn btn-primary" to="/getMoto">GET</Link> <br/><br/>
                    <Link className="btn btn-primary" to="/addMoto">POST</Link> <br/><br/>
                    <Link className="btn btn-primary" to="/editMoto">PUT</Link> <br/><br/>

                </div>
            </div>
    );
  }

  export default Welcome
